import { Login } from './Components/Login.js';
import { Signup } from './Components/Signup.js';
//import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import { MDBContainer } from 'mdb-react-ui-kit';
import TypeWriterEffect from 'react-typewriter-effect';



function App() {
  return (
    <Router>
      <MDBContainer className="border border-primary" fluid>
        <div className="row row-cols-2 d-flex align-items-center " style={{height: "100vh" }}>

          <div className="col bg-dark d-flex align-items-center justify-content-center text-white" style={{height: "100vh" }}>
            <div></div>
            <TypeWriterEffect
            textStyle={{ fontFamily: 'Red Hat Display' }}
            startDelay={100}
            cursorColor="black"
            text="Thi"
            typeSpeed={100}
            scrollArea={myAppRef}
            />
          </div>

          <div className="col">
              <Switch>
                <Route exact path="/">
                  <Login />
                </Route>
                <Route path="/signup">
                  <Signup/>                                  
                </Route>
              </Switch>
          </div>

        </div>
      </MDBContainer>
    </Router>
  );
}

export default App;
